using System;

namespace AdventOfCode
{
    class Second
    {
        enum Direction { Up, Down, Left, West };
        static void Run()
        {
            int currentNumber = 5;

            //string str = "";
            //string str = "";
            //string str = "";
            //string str ="";
            string str = "";

            string result = "";
            while (str.Length > 0)
            {
                string a = str.Substring(0, 1);
                str = str.Substring(1);

                switch (a)
                {
                    case "U":
                        if (currentNumber > 3)
                        {
                            currentNumber = currentNumber - 3;
                            result = result + currentNumber;
                        }
                        break;
                    case "D":
                        if (currentNumber < 7)
                        {
                            currentNumber = currentNumber + 3;
                            result = result + currentNumber;
                        }
                        break;
                    case "R":
                        if (!(currentNumber == 3 || currentNumber == 6 || currentNumber == 9))
                        {
                            currentNumber++;
                            result = result + currentNumber;
                        }
                        break;
                    case "L":
                        if (!(currentNumber == 1 || currentNumber == 4 || currentNumber == 7))
                        {
                            currentNumber--;
                            result = result + currentNumber;
                        }
                        break;
                }                
            }

            Console.WriteLine(result);
        }
    }
}